var AreaManager = function (state, city, area, stateval, cityval, areaval, callback) {
    var _State = "", _City = "", _Area = "";
    var _StateId = "", _CityId = "", _AreaId = "";
    function LoadStates() {
        $(_StateId).empty().append('<option value="0">请选择</option>');
        $(_CityId).empty().hide();
        $(_AreaId).empty().hide();
        for (var name in certSealArea) {
            if (!certSealArea.hasOwnProperty(name)) continue;
            if (certSealArea[name].name == _State) {
                $(_StateId).append('<option value="' + name + '" selected="selected">' + certSealArea[name].name + '</option>');
                LoadCitys(name);
            } else {
                $(_StateId).append('<option value="' + name + '">' + certSealArea[name].name + '</option>');
            }
        }
    }
    function LoadCitys(state) {
        var _state = certSealArea[state];
        if (!_state) {
            return;
        }
        $(_CityId).empty().show().append('<option value="0">请选择</option>');
        $(_AreaId).empty().hide();
        var Citys = _state.items;
        for (var name in Citys) {
            if (!Citys.hasOwnProperty(name)) continue;
            if (Citys[name].name == _City) {
                $(_CityId).append('<option value="' + name + '" selected="selected">' + Citys[name].name + '</option>');
                LoadAreas(name);
            } else {
                $(_CityId).append('<option value="' + name + '">' + Citys[name].name + '</option>');
            }
        }
    }
    function LoadAreas(city) {
        var state = $(_StateId).val();
        if (!state || state == '0') {
            return;
        }
        if (!certSealArea[state] || !certSealArea[state].items[city]) {
            return;
        }
        $(_AreaId).empty().show().append('<option value="0">请选择</option>');
        var Areas = certSealArea[state].items[city].items;
        for (var name in Areas) {
            if (!Areas.hasOwnProperty(name)) continue;
            if (Areas[name] == _Area) {
                $(_AreaId).append('<option value="' + name + '" selected="selected">' + Areas[name] + '</option>');
            } else {
                $(_AreaId).append('<option value="' + name + '">' + Areas[name] + '</option>');
            }
        }
    }
    _State = stateval || "";
    _City = cityval || "";
    _Area = areaval || "";
    _StateId = state;
    _CityId = city;
    _AreaId = area;
    $(_StateId).on("change", function () {
        LoadCitys(this.value);
    });
    $(_CityId).on("change", function () {
        LoadAreas(this.value);
    });
    $(_AreaId).on("change", function () {
        if(typeof callback == 'function'){
	        callback($(_StateId).val(), $(_CityId).val(), this.value);
        }
    });
    LoadStates();
};
AreaManager.GetArea = function(a, b, c){
	return AreaManager.GetAreaArray(a, b, c).join(' ');
};
AreaManager.GetAreaArray = function(a, b, c){
	var str = [];
	var _a = certSealArea[a];
	if(!_a){
		return str;
	}
	str.push(_a.name);
	_a = _a.items[b];
	
	if(!_a){
		return str;
	}
	str.push(_a.name);
	str.push(_a.items[c] || '');
	return str;
};
